import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBIcon,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import Band from './band1';
import Singer from './singer';
import Dance from './dance';
import Beats from './beats';
import AlumniTeam from './alumniteam';
import Comedy from './comedy';
import './cards.css';
import Nilesh from './nilesh';
import Kaustav from './kaustav';

class Team extends React.Component {
    render() {
        return(
            <MDBContainer className="mt-5 p-3" >
            <div>
            
     
          
            <h2>Our Team</h2>
            <br/><br/>
                <MDBRow align="center">
              <MDBCol md="3" lg="3" sm="5" ><Nilesh/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>            
              </MDBRow>
              <MDBRow align="center">
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
             
              </MDBRow>
              <MDBRow align="center">
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
              <MDBCol md="3" lg="3" sm="5"><Band/></MDBCol>
             
              </MDBRow>
           
                <br/><br/>
            
            </div>
            </MDBContainer>
        );
    }
}

export default Team;
